import React from "react";
const designTips = {
  span: "DESIGN.",
  strong: " FIT FOR THE STRIP",
  p:
    "The design choices highlight the uniqueness of the idea behind the Rush, a bike meant for those who are not afraid to stand-out of the crowd with out-of-the-ordinary details, such as she lenticular rear-wheel, typical of acceleration races.",
  src: "rush1000/design.jpg",
};
export default function DesignTips() {
  return (
    <>
      <div className="designTips-layout">
        <div className="designTips-container">
          <div className="designTips-header">
            <span>{designTips.span}</span>
            <strong> {designTips.strong}</strong>
          </div>
          <p className="designTips-content">
            {designTips.p}
          </p>
          <div className="designTips-bt">
            <p>LEARN MORE </p>
            <span className="bt-plus bt-plus-icon"></span>
          </div>
        </div>
        <div
          className="designTips-bg parallax"
          style={{ backgroundImage: `url(./img/${designTips.src})` }}
        ></div>
      </div>
    </>
  );
}
